    "2016-03-31T23:58:41.899044",nt"name": "enviroatlas-average-annual-precipitation-1981-2010-by-huc12-for-the-conterminous-united-states",nt"isopen":
    false,nt"url": null,nt"notes": "This EnviroAtlas dataset provides the average
    annual precipitation by 12-digit Hydrologic Unit (HUC). The values were estimated
    from maps produced by the PRISM Climate Group, Oregon State University. The original
    data was at the scale of 800 m grid cells representing average precipitation from
    1981-2010 in mm. The data was converted to inches of precipitation and then zonal
    statistics were estimated for a final value of average annual precipitation for
    each 12 digit HUC. For more information about the original dataset please refer
    to the PRISM website at http://www.prism.oregonstate.edu/. This dataset was produced
    by the US EPA to support research and online mapping activities related to EnviroAtlas.
    EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to interact with a
    web-based, easy-to-use, mapping application to view and analyze multiple ecosystem
    services for the contiguous United States. The dataset is available as downloadable
    data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas map
    service. Additional descriptive information about each attribute in this dataset
    can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
